description:
Set in the city of Olympus, Briareos, a cyborg soldier and Deunan, a young female warrior, are both partners and lovers. As members of the special elite force, their duties are to help protect and maintain the city.
The two fighters find their partnership tested in a new way by the arrival of a new member to their ranks named Tereus. Using Briareos&amp;#039;s DNA as a blueprint, Tereus uncannily resembles Briareos...both physically and mentally. Tereus also has strong romantic feelings for Deunan..... Who does she choose?

